import { Slide } from "react-awesome-reveal";

const TimeUntil = () => {
  return (
    <Slide left delay={500}>
      <div>
        <div className="countdown_wrapper">
          <div className="countdown_top">Event starts in</div>
          <div className="countdown_bottom">

          </div>
        </div>
      </div>
    </Slide>
  );
};
export default TimeUntil;
